import React from 'react'
import '../App.css'
import { useState, useEffect } from 'react'

function NotesList() {
  const [Notes, setNotes] = useState([])
  async function getNotes() {
    let res = await fetch('http://127.0.0.1:8000/notes')
    let data = await res.json()
    setNotes(data)
  }
  useEffect(() => {
    getNotes()
  }, [])
  return (
    <div className="Notes">
      {Notes.map((Note) => {
        return (
          <>
          <hr />
          <div className='Note' id={Note.id}>
            <h3>{Note.name}</h3>
            <p>{Note.note}</p>
          </div>
          </>
        )
      })}
      <input onClick={(e) => {
        console.log(e.target.className = 'add ')
      }} className='add' type="button" value="+" />  
    </div>
  )
}

export default NotesList
